import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
const StoryModal = () => {

  const images = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
        "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",



  ]
  useEffect(() => {

    if (!localStorage.getItem('userToken')) {
      goto('/login')
    }

  }, [])

  const goto = useNavigate()
  const goProfile = () => {
    goto('/profile')
  }

  const [currentSlide, setCurrentSlide] = useState(0);

  const nextSlide = () => {
    setCurrentSlide((prevSlide) => (prevSlide + 1) % images.length);
  };

  const prevSlide = () => {
    setCurrentSlide((prevSlide) => (prevSlide - 1 + images.length) % images.length);
  };



  const [isOpen, setIsOpen] = useState(true)

  const handleOpenModal = () => {
    setIsOpen(true)
  };

  const handleCloseModal = () => {
    setIsOpen(false)
  };

  return (
    <>
      <div className='bg-white fixed top-16 right-32 rounded-full px-2'>
        <Link to='/'>X</Link>
      </div>

      {isOpen && (
        <div className="modal-overlay flex items-center justify-center h-screen bg-gray-700">
          <div className="modal-content w-full h-full sm:w-96 sm:h-2/3">
            <div className="relative">
              {/* Carousel Slides */}
              <div className="overflow-hidden">
                <div className="flex transition-transform duration-300 ease-in-out -translate-x-full " style={{ transform: `translateX(-${currentSlide * 100}%)` }}>
                  {images.map((image, index) => (
                    <div key={index} className="w-full flex-shrink-0 relative ">
                      <img src={image} alt={`Slide ${index + 1}`} className="w-full h-auto" />

                      {/* User Profile Picture */}
                      <div className="absolute top-4 left-4 flex px-1" onClick={goProfile}>
                        <img src={"https://i1.sndcdn.com/avatars-000252187355-42nbzf-t500x500.jpg"} alt="User Profile" className="w-7 h-7 rounded-full" />
                        <span className="text-sm font-bold mt-1 ml-1">User007</span>
                      </div>


                    </div>
                  ))}
                </div>
              </div>

              {/* Navigation Buttons */}
              <div className="absolute top-1/2 left-0 right-0 flex justify-between px-4">
                <button onClick={prevSlide} className="text-white  text-2xl focus:outline-none">
                  &lt;
                </button>
                <button onClick={nextSlide} className="text-white text-2xl focus:outline-none">
                  &gt;
                </button>
              </div>
            </div>


          </div>
        </div>
      )}
    </>
  );
};

export default StoryModal;
